men&quot;\\n&quot;Ich freue mich, dass...&quot;\\nGerte werden umgestpselt\\nForderung lauter zu sprechen\\nDank Maske unverstndliche Frage\\nBeschwerde ber Temperatur\\n&quot;Aufsichten!&quot;\\n&quot;Die Nachbarschule&quot;\\n&quot;Eltern haben mir gesagt...&quot;\\nBeginn mit &gt;10 Minuten Verzgerung\\n&quot;Lften!&quot;\\niPads\\nCorona-Manahmen\\n&quot;Mchten Sie dazu noch kurz was sagen?&quot;\\nWortgefecht innerhalb des Kollegiums\\nWortgefecht mit Schulleitung\\n&quot;Versteht man mich?&quot;\\n&quot;Ich bin fr Kritik immer dankbar&quot;\\nPsychologie studiert!\\n&quot;Da habe ich ja auch Erfahrung&quot;\\nZu viele Ausrufezeichen auf der PowerPoint\\n&quot;Ich habe ja keine Angst vor den Anmeldezahlen, aber...&quot;\\nTechnik funktioniert nicht\",\"taskDescription\":\"\"}","library":"H5P.Bingo 0.2","contentUrl":".","metadata":{"license":"U","title":"Konferenz-Bingo","defaultLanguage":"und"},"scripts":["/api/v1/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/api/v1/h5p/libraries/Tether-1.0/scripts/tether.min.js?version=1.0.2","/api/v1/h5p/libraries/Drop-1.0/js/drop.min.js?version=1.0.2","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.10","/api/v1/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?versi
